import Tabs, { Tab } from "react-best-tabs";
import "react-best-tabs/dist/index.css";
import "./App.css";

function App() {
  return (
    <div>
      <div
        style={{
          backgroundColor: "#B1BC55",
          margin: 0,
          height: 50,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          color: "white",
        }}
      >
        <div>Caption Generator</div>
      </div>

      <Tabs
        activeTab="1"
        className=""
        ulClassName=""
        activityClassName="bg-success"
        onClick={(event, tab) => console.log(event, tab)}
      >
        <Tab title="tab 1" className="mr-3">
          <div className="mt-3">Tab 1 content</div>
        </Tab>
        <Tab title="tab 2" className="mr-3">
          <div className="mt-3">Tab 2 content</div>
        </Tab>
        <Tab title="tab 3" className="mr-3">
          <div className="mt-3">Tab 3 content</div>
        </Tab>
      </Tabs>
    </div>
  );
}

export default App;
